$('#guo-sou-ajax').click(function(){
	console.log($(this).attr("data-action"))
	$.ajax({
		url: $(this).attr("data-action"),
		type: 'POST',
		data:{
			'number':$('#number_guo_ajax').val(),
			'Devicenumber':$('#Devicenumber_guo_ajax').val(),
			'starttime':$('#starttime_guo_ajax').val(),
			'endtime':$('#endtime_guo_ajax').val(),
			'State':$('#State_guo_ajax').val(),
			'csrfmiddlewaretoken': $('[name="csrfmiddlewaretoken"]').val()
		},
		success:function(data){
				var latest_report = JSON.parse(data);
				var tr_html = '';
				var url = $('#models_guo_from1').attr('action');
				var csrfmiddlewaretoken = $('[name="csrfmiddlewaretoken"]').val()
				$('.guo-models-1').empty();

				for (var i = 0; i < latest_report.subclass.length; i++) {
					report_info = latest_report.subclass[i];
					tr_html += '<td class="guo-td-1"><center>'
                                    + report_info.id + '</center></td><td class="guo-td-2"><center>'
                                    + report_info.number + '</center></td><td class="guo-td"><center>'
                                    + report_info.name + '</center></td><td class="guo-td"><center>'
                                    + report_info.DeviceID + '</center></td><td class="guo-td"><center>'
                                    + report_info.State + '</center></td><td class="guo-td"><center>'
                                    + report_info.Type + '</center></td><td class="guo-td"><center>'
                                    + report_info.Money + '元</center></td><td class="guo-td"><center>'
                                    + report_info.endtime + '</center></td>' + '<td class="guo-td"><div><form method="post" action='+ url +'><input type="hidden" name="csrfmiddlewaretoken" value='+ csrfmiddlewaretoken +'><input  type="hidden" name="id" value='+ report_info.id +'><center><input type="submit" value="查看详细信息"></center></form></div></td>';
		}
		$('.guo-models-1').html(tr_html);
		},
	})
})

